import React from "react";

const TotalPrice = () => {
  return (
    <div>
      <div>Total Price: Price</div>
      <div>Quantity
        <button>+</button>
        <button>No</button>
        <button>-</button>
      </div>
      <div>
        <button></button>
      </div>
    </div>
  );
};

export default TotalPrice;
